import React from 'react';
import styled from 'styled-components';

const Wrapped = styled.div`
    position: relative;
    overflow: hidden;
    width: 100%;
    height: 100%;
    background-image: url('https://picsum.photos/1000/1000');
    filter: blur(10px);
    &:before {
        content: '';
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background-image: url('https://picsum.photos/1000/1000');
        opacity: 0.5;
        filter: blur(50px);
    }
    &:after {
        content: '';
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background-image: url('https://picsum.photos/1000/1000');
        opacity: 0.5;
        filter: blur(100px);
    }
`;

